post_text:
[#KIPPNYC President Alicia] Johnson says KIPP schools spent the summer improving remote instruction, knowing that even when in-person instruction resumes, students will still learn in class and at home on alternating days. “We’re going to be doing some version of this all year, so let’s make it really good,” she said.
